@use "./variables" as *;

*,
*::after,
*::before {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

html {
  font-size: 16px;
}

body {
  line-height: 1.4;
  color: hsl(120, 12%, 34%);
  background: hsl(133, 60%, 97%);
  text-align: center;
}

h1 {
  font-size: 48px;
  margin: 0;
}

li {
  list-style-type: none;
  list-style-position: outside;
}

.clr-red {
  color: $red;
}

.footer-bg {
  background-color: $footer-clr;
}

.container {
